import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap';
import '../node_modules/bootstrap/dist/css/bootstrap.css';




class App extends Component {

  constructor(props){
    super(props);

    this.state = {dados:[
      {componente:'Primeiro...',
      id:1},
      {componente:'Segundo...',
      id:2},
      {componente:'Terceiro...',
      id:3}
    ]}

  }




  render() {

    return (
      <div class="container">

          {this.state.dados.map((info,chave) => <Conteudo key = {chave} dadosComponente = {info} />)}         
       </div>
    )
  }
}


class Conteudo extends Component{
   render(){
      return ( 
          <div>
            <div>{this.props.dadosComponente.componente}</div>             
          </div>

      )
   }
}

export default App;
